INSERT INTO `v1_3088d8106bd827cd44964b27e275be5704751fbc28df12a83cc4c53510316f68` VALUES (101, "仲間と夏を楽しむ、夏海の魔法士。自分を変えたいという固い決意で、障害物を無効化して走り続ける。", 1, 0.029, 105, 0, 0, 1, 122601, 160, 1, 1, 1.5, 110);
INSERT INTO `v1_3088d8106bd827cd44964b27e275be5704751fbc28df12a83cc4c53510316f68` VALUES (102, "太陽よりも輝く、夏海の元気娘。　持ち前の身体能力で、どんなコースも柔軟に対応し、駆け抜ける。", 3, 0.014, 111, 0, 1, 2, 122401, 120, 2, 0, 2.5, 105);
INSERT INTO `v1_3088d8106bd827cd44964b27e275be5704751fbc28df12a83cc4c53510316f68` VALUES (103, "波打ち際に煌めく、夏海の剣士。　日々の鍛錬で鍛えた脚で、長い距離も速度を落とさず走り切る。", 2, 0.017, 105, 1, 0, 3, 122501, 350, 3, 0, 2.5, 110);
INSERT INTO `v1_3088d8106bd827cd44964b27e275be5704751fbc28df12a83cc4c53510316f68` VALUES (104, "海の幸に目がない、渚のお姫様。　『王家の装備』の力を解放し、障害物をものともせず前へと進む。", 3, 0.016, 105, 0, 1, 4, 107501, 130, 4, 0, 1.5, 110);
INSERT INTO `v1_3088d8106bd827cd44964b27e275be5704751fbc28df12a83cc4c53510316f68` VALUES (105, "海でも主さまをお世話する、白浜の巫女。精霊の力で自身を加速させ、誰よりも速くゴールを目指す。", 1, 0.014, 105, 0, 0, 5, 107601, 160, 5, 1, 2.5, 110);
INSERT INTO `v1_3088d8106bd827cd44964b27e275be5704751fbc28df12a83cc4c53510316f68` VALUES (106, "水着姿を恥じらう、ツンデレ猫娘。お得意の魔法で、対戦相手の走りを妨害し、レースを有利に進める。", 2, 0.029, 103, 1, 0, 6, 107801, 255, 6, 0, 3.5, 120);
INSERT INTO `v1_3088d8106bd827cd44964b27e275be5704751fbc28df12a83cc4c53510316f68` VALUES (107, "優雅に浜を駆ける、真夏のマホ姫。しゃなりしゃなりと、雅な身のこなしで障害物を跳び越えていく。", 1, 0.013, 103, 0, 0, 7, 110601, 160, 7, 1, 3.5, 120);
INSERT INTO `v1_3088d8106bd827cd44964b27e275be5704751fbc28df12a83cc4c53510316f68` VALUES (108, "浜の平和を守る、真夏の狼娘。　　獣人の強靭なスタミナで、レース　後半にスパートをかける。", 2, 0.014, 103, 1, 0, 8, 110401, 350, 8, 0, 2.5, 110);
INSERT INTO `v1_3088d8106bd827cd44964b27e275be5704751fbc28df12a83cc4c53510316f68` VALUES (109, "浜に力強く舞う、真夏の南国娘。　レースの喧噪の中でも精神を乱さず後半に大きな捲りを見せる。", 3, 0.012, 100, 0, 1, 9, 110501, 130, 9, 0, 1.5, 105);
INSERT INTO `v1_3088d8106bd827cd44964b27e275be5704751fbc28df12a83cc4c53510316f68` VALUES (110, "浜の事件を嗅ぎ付けた、真夏の　　名探偵。高い推理力と魔法で、的確に対戦相手の走りを乱す。", 1, 0.014, 103, 0, 0, 10, 115701, 200, 10, 1, 2.5, 105);
INSERT INTO `v1_3088d8106bd827cd44964b27e275be5704751fbc28df12a83cc4c53510316f68` VALUES (111, "再び鎧を脱いだ、灼熱の騎士団長。実戦で培った判断力で、瞬時にバリアを展開し、障害物を無力化する。", 2, 0.071, 103, 1, 0, 11, 113601, 350, 11, 0, 2.5, 105);
INSERT INTO `v1_3088d8106bd827cd44964b27e275be5704751fbc28df12a83cc4c53510316f68` VALUES (112, "水が苦手な、海辺の気まぐれ猫娘。浜に現れた美少女義賊は、対戦相手のスピードを奪いとる。", 3, 0.014, 103, 0, 1, 12, 107901, 130, 12, 0, 1.5, 120);
INSERT INTO `v1_3088d8106bd827cd44964b27e275be5704751fbc28df12a83cc4c53510316f68` VALUES (113, "バカンスも効率第一な、海の傭兵。レースでも最高効率を求め、どんな状況でも隙のない走りを見せる。", 2, 0.022, 105, 0, 0, 13, 108001, 200, 13, 1, 1.5, 110);
INSERT INTO `v1_3088d8106bd827cd44964b27e275be5704751fbc28df12a83cc4c53510316f68` VALUES (114, "真夏の太陽が良く似合う、海辺の　サレンママ。多才で器用、どんな　障害物もエレガントに越えていく。", 1, 0.031, 108, 0, 0, 14, 110301, 160, 14, 1, 2.5, 110);
INSERT INTO `v1_3088d8106bd827cd44964b27e275be5704751fbc28df12a83cc4c53510316f68` VALUES (115, "海に嵐を呼ぶ夏のドジっ娘メイド。日頃から災難に慣れており、多少　のトラブルには動じたりしない。", 1, 0.036, 105, 0, 1, 15, 107701, 130, 15, 0, 0.5, 110);
INSERT INTO `v1_3088d8106bd827cd44964b27e275be5704751fbc28df12a83cc4c53510316f68` VALUES (116, "粋な夏を愉しむ、若夏の姉御。　　流麗な身体捌きで、始・継・終と、UBを重ねるごとに、加速する。", 2, 0.048, 95, 1, 0, 16, 113101, 350, 16, 0, 3.5, 110);
INSERT INTO `v1_3088d8106bd827cd44964b27e275be5704751fbc28df12a83cc4c53510316f68` VALUES (117, "夏のトキメキに触れた、オタク魔法少女。多彩な魔法を操り、少しずつ他の走者の速度を落とし続ける。", 3, 0.043, 105, 0, 1, 17, 113301, 130, 17, 0, 1.5, 105);
INSERT INTO `v1_3088d8106bd827cd44964b27e275be5704751fbc28df12a83cc4c53510316f68` VALUES (118, "海獄に降臨せし、真夏の冥姫。　　レース後半に魔力を全解放し、　　蒼き疾風と成りて浜を駆け抜ける。", 2, 0.018, 95, 0, 1, 18, 113201, 130, 18, 0, 1.5, 105);
INSERT INTO `v1_3088d8106bd827cd44964b27e275be5704751fbc28df12a83cc4c53510316f68` VALUES (119, "夏の夕を火花で彩る、渚の壊し屋。『壊し屋』の異名と過激な愛情は、対戦相手にプレッシャーを与える。", 2, 0.021, 108, 0, 0, 19, 117001, 160, 19, 1, 2.5, 110);
INSERT INTO `v1_3088d8106bd827cd44964b27e275be5704751fbc28df12a83cc4c53510316f68` VALUES (120, "青春に生きる者を導く、夏の先生。夢へと邁進する聖母の加護が、その身をあらゆる困難から守る。", 1, 0.036, 105, 1, 0, 20, 113501, 255, 20, 0, 2.5, 110);
INSERT INTO `v1_3088d8106bd827cd44964b27e275be5704751fbc28df12a83cc4c53510316f68` VALUES (121, "笑顔の応援が眩しい、夏の超能力　ガール。超能力を駆使して、どんな障害物もひとっ飛びで乗り越える。", 3, 0.02, 105, 1, 0, 21, 113401, 350, 21, 0, 2.5, 105);
INSERT INTO `v1_3088d8106bd827cd44964b27e275be5704751fbc28df12a83cc4c53510316f68` VALUES (122, "海辺で大人の魅力を放つ、夏の　　セクシー先生。その魅力に囚われた対戦相手は、走りを乱してしまう。", 1, 0.018, 105, 0, 1, 22, 110101, 130, 22, 0, 2.5, 110);
INSERT INTO `v1_3088d8106bd827cd44964b27e275be5704751fbc28df12a83cc4c53510316f68` VALUES (123, "水着も絶対外さない、夏のカリスマモデル。走りのバイブスは超テンアゲで、スピードはおにやば。", 3, 0.03, 111, 0, 0, 23, 110001, 160, 23, 1, 3.5, 105);
INSERT INTO `v1_3088d8106bd827cd44964b27e275be5704751fbc28df12a83cc4c53510316f68` VALUES (124, "南の島も盛り上げる、真夏のアイドル。悪天候でも笑顔を絶やさず後半もリズムを上げて走り切る。", 1, 0.027, 103, 0, 1, 24, 117201, 130, 24, 0, 1.5, 110);
INSERT INTO `v1_3088d8106bd827cd44964b27e275be5704751fbc28df12a83cc4c53510316f68` VALUES (125, "海原に美声を響かす、渚の歌姫。　守護の賛歌と精霊の加護により、　障害物から身を守る。", 2, 0.02, 108, 0, 0, 25, 117301, 160, 25, 1, 3.5, 105);
INSERT INTO `v1_3088d8106bd827cd44964b27e275be5704751fbc28df12a83cc4c53510316f68` VALUES (126, "夏でも天邪鬼な、夕凪のテーラー。張り巡らされた魔法の糸で、他の走者の自由を奪う。", 3, 0.04, 105, 1, 0, 26, 117401, 350, 26, 0, 2.5, 110);
INSERT INTO `v1_3088d8106bd827cd44964b27e275be5704751fbc28df12a83cc4c53510316f68` VALUES (127, "向日葵が良く似合う、海辺の　　　お姉ちゃん。秘密結社の一員で、　抜群の身体能力が一番の武器。", 1, 0.009, 105, 1, 0, 27, 117101, 350, 27, 0, 3.5, 110);
INSERT INTO `v1_3088d8106bd827cd44964b27e275be5704751fbc28df12a83cc4c53510316f68` VALUES (128, "渚でおっとり、夏色うさぎっこ。　うさぎさんパワー全開で、ぴょん　ぴょんとコースを跳ね回る。", 1, 0.022, 105, 1, 0, 28, 122901, 255, 28, 0, 3.5, 120);
INSERT INTO `v1_3088d8106bd827cd44964b27e275be5704751fbc28df12a83cc4c53510316f68` VALUES (129, "無邪気さ弾ける、夏色いたずら娘。砂浜でも、いたずらの準備は万端！レースに大波乱が巻き起こる！？", 3, 0.028, 105, 0, 1, 29, 122801, 130, 29, 0, 2.5, 110);
INSERT INTO `v1_3088d8106bd827cd44964b27e275be5704751fbc28df12a83cc4c53510316f68` VALUES (130, "海でも真面目な、夏色優等生。　　高めた魔力を解き放ち、一瞬の内に他の走者を置き去りにする。", 2, 0.023, 108, 0, 0, 30, 122701, 130, 30, 1, 3.5, 105);
